from models import db, connect_db, User, Post
from app import app

# Drop all tables and create them anew
with app.app_context():
    db.drop_all()
    db.create_all()

    # If tables aren't empty, empty them
    User.query.delete()
    Post.query.delete()

    # Add sample users
    user1 = User(first_name="Paulo", last_name="Carrera", image_url="data:image/jpeg;base64,")
    user2 = User(first_name="Kendrick", last_name="Lamar", image_url="data:image/jpeg;base64,")
    user3 = User(first_name="Abraham", last_name="Lincoln", image_url="data:image/webp;base64,")
